package common

import (
	"testing"

	"github.com/stretchr/testify/require"
)

func TestEnum_CAMERA_TRACKING_STATUS_FLAGS(t *testing.T) {
	t.Run("zero", func(t *testing.T) {
		var e CAMERA_TRACKING_STATUS_FLAGS
		e.UnmarshalText([]byte{})
		e.MarshalText()
		e.String()
	})

	t.Run("first entry", func(t *testing.T) {
		enc, err := CAMERA_TRACKING_STATUS_FLAGS_IDLE.MarshalText()
		require.NoError(t, err)

		var dec CAMERA_TRACKING_STATUS_FLAGS
		err = dec.UnmarshalText(enc)
		require.NoError(t, err)

		require.Equal(t, CAMERA_TRACKING_STATUS_FLAGS_IDLE, dec)
	})
}
